import request from '@/utils/request';
import { host } from "./utils";
export function login(data) {
  return request({
    url: host + '/api/manager/login',
    method: 'post',
    data: data
  });
}
export function getInfo(token) {
  return request({
    url: host + '/api/manager/info',
    method: 'get',
    params: {
      token: token
    }
  });
}
export function getManagerList(params) {
  return request({
    url: host + '/api/manager/list',
    method: 'get',
    params: params
  });
}
export function logout() {
  return request({
    url: '/user/logout',
    method: 'post'
  });
}
